import React from "react";

export default function Login() {
    function login() {
        const form = document.querySelector('form');
        form.onSubmit = (event) => { event.preventDefault(); }


        const user = {

            mail: 'sus.sus123456@gmail.com',
            password: 12345
        }
        let mail = document.querySelector('#mail').value
        let password = document.querySelector('#password').value

        let info = {
            mail: mail,
            password: password

        }
        if (info.mail === user.mail) {

            window.self('http://localhost:3000/page1')

        }
        else {
            console.log("Your out!")
        }
    }


    return (

        <div>
            <form>
                <input id="mail" type="mail" placeholder="Mail" required></input>
                <input id="password" type="password" placeholder="Password" required></input>
                <button type="submit" onClick={login}>submit</button>
            </form>
        </div >
    )
}
